import './App.css';
import React from 'react';
import {StyleSheet, View} from 'react-native';

const Flex = () => {
  return (
  <View style={{flex: 1, flexDirection: 'column', backgroundColor: 'black', height: 100}}>
    <View style={{flex: 1, flexDirection: 'row', backgroundColor: 'green'}}/>
    <View style={{flex: 1, flexDirection: 'row', backgroundColor: 'yellow'}}/>
    <View style={{flex: 1, flexDirection: 'row', backgroundColor: 'orange'}}/>
  </View>
)};

export default Flex;
